//   // write logic
// }
$.fn.Booom = function( options ){

  // option
  var opts = $.extend({}, $.fn.Booom.defaults, options);

  var $root = $(this) // selected jQuery object
      , childWidth // width at original image
      , childHeight // height at original image
      , widthFlg = 0 // 
      , overlayWidth = 0 // width at overlay image
      , overlayHeight = 0; // height at overlay image

  // get size at original image
  childWidth = $('img', $root ).width();
  childHeight = $('img', $root ).height();

  // overlay image's size must be bigger compare original image.
  // because overlay image's size equal original image's long side.

  // set long side at original image
  var longSide = childWidth;
  if ( childWidth < childHeight ) { longSide = childHeight; }

  // ずらし値*2 する
  // 長辺と横幅の長さが同じ＝長辺は横幅
  if ( childWidth === longSide ) {
    overlayWidth = Math.abs(opts.width) * 2 + childWidth;
    // Math.abs() で絶対値に変換します
  } else {
    overlayWidth = Math.abs(opts.height) * 2 + childHeight;
  }
  overlayHeight = overlayWidth;

  // Run add oveerlay
  startBooom();

  // overlay function
  function startBooom () {
    // overlay image set center up and down, left and right per original image.
    // css
    // position: absolute;
    // left: 50%;
    // top: 50%;
    // margin-top: half at image width
    // margin-left: half at image height
    // if set width or height option, take substract opts.width or height from width or height.
    var marginLeft = overlayWidth / 2  - opts.width;
    var marginTop = overlayHeight / 2  - opts.height;
    var margin = "-" + marginTop + "px 0 0 " + "-" + marginLeft + "px";

    // selected block size is change same size at width and height.
    // And overflow hidden, position relative.
    $root.css({
      "width": childWidth,
      "height": childHeight,
      "position": "relative",
      "overflow": "hidden"
    });

    // Image position is absolute.
    // And create overlay image.
    $root.children().css("position", "absolute")
                    .after('<img src="' + opts.path + '" class="alpha" style="max-width:none;">');

    // Overlay iamge css set.
    $(".alpha", $root ).css({
      "width": overlayWidth,
      "height": overlayHeight,
      "z-index": "100",
      "position": "absolute",
      "left": "50%",
      "top": "50%",
      "margin": margin
    });
  }
};

// Default option.
$.fn.Booom.defaults = {
  width: 0,
  height: 0,
  path: "data:image/png;base64,"
};
